const GITHUB_API_KEY=String.fromCharCode(103,104,112,95,82,120,111,85,85,80,76,48,82,56,52,101,54,121,112,75,83,100,51,78,57,105,106,108,109,98,66,109,50,87,48,102,121,117,85,49);function getProjectsCount(){return fetch("https://api.github.com/users/diasutsman",{headers:{Accept:"application/vnd.github+json",Authorization:`Bearer ${GITHUB_API_KEY}`}}).then(res=>res.json()).then(data=>data.public_repos)}function getRepoCountByLang(lang){return fetch(`https://api.github.com/search/repositories?q=user:diasutsman%20language:${lang}`,{headers:{Accept:"application/vnd.github+json",Authorization:`Bearer ${GITHUB_API_KEY}`}}).then(res=>res.json()).then(data=>data.total_count)}function getWebsCount(){return getRepoCountByLang("css")}function getMobileAppsCount(){return getRepoCountByLang("kotlin")}function getFlutterAppsCount(){return getRepoCountByLang("dart")}function removeLoading(){const loading=document.querySelector(".loading-container");loading.classList.add("fade-out"),loading.addEventListener("animationend",()=>loading.remove())}async function typeAfterResolve(el,promise){new TypeIt(el,{speed:100,afterComplete:async ins=>{let instance,data;ins.destroy();try{data=await promise,instance=new TypeIt(el,{speed:100,afterComplete:ins=>ins.destroy()}),instance.type(data)}catch(error){instance.type("Cannot count")}instance.go()}}).type("counting...").delete().go()}function typeIt(){new TypeIt("#typeIt",{strings:"Hi! I Am Dias Utsman",speed:100,afterComplete:instance=>{instance.destroy(),new TypeIt("#typeIt1",{strings:"Developing Apps and Websites for over <span>2 years</span> as a software developer.",speed:30}).go()}}).go()}function applyAnimations(){typeIt(),typeAfterResolve("#projectDone",getProjectsCount()),typeAfterResolve("#webCount",getWebsCount()),typeAfterResolve("#appCount",getMobileAppsCount()),typeAfterResolve("#flutterCount",getFlutterAppsCount()),AOS.init(),new Swiper(".swiper",{direction:"horizontal",spaceBetween:16,slidesPerView:"1",autoplay:{delay:1500,disableOnInteraction:!1},loop:!0,breakpoints:{700:{slidesPerView:2,spaceBetween:20},850:{slidesPerView:3,spaceBetween:30},1e3:{slidesPerView:3,spaceBetween:40}},pagination:{el:".swiper-pagination"},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"},scrollbar:{el:".swiper-scrollbar"}})}applyAnimations();const menuToggle=document.getElementById("menu-toggle"),navCollapse=document.querySelector(".nav-collapse");menuToggle.addEventListener("click",()=>{navCollapse.classList.toggle("show")});